import React, { useEffect, useState } from 'react';

function Photo() {

    const [image, setImage] = useState([]);

    useEffect(() => {
        fetchPhoto();
    }, [])



    const fetchPhoto = async () => {
        const randId = Math.floor(Math.random() * (33333 - 10000 + 1)) + 10000;
        const photoURL = `https://pixabay.com/api/?key=16806694-8789b173812b34e350141a20b&id=${randId}&image_type=photo`;

        const photoFetch = await fetch(photoURL);
        const data = await photoFetch.json();

        console.log(data.hits[0]);
        console.log(randId);
    }


    return (
        <h1>Photo</h1>
    );
}

export default Photo;
